import { StaticDatePicker } from '@mui/x-date-pickers/StaticDatePicker';

const calendar = () => {

  return (
    <div>

        <LocalizationProvider dateAdapter=
        {AdapterDateFns}>
      <StaticDatePicker 
      orientation="landscape" 
      openTo="day"
      value={value}
      onChange={(newValue) => {
        setValue(newValue);
      }}
      renderInput={(params) => <TextField {...
        params} />}
        />
    </LocalizationProvider>
    </div>
  )
}

export default calendar
